import { Link } from 'react-router-dom';
import './Navigation.scss';

function Navigation() {

  return (
    <div className="navigation-wrapper">
      <Link to='/workout'>Start Workout</Link>
      <Link to='/list'>Exercise List</Link>
    </div>
  );
}

export default Navigation;
